layout_tree.textContent:
Table Simple: Empty Cells

        body { margin: 16px; }
        .show-empty {
            empty-cells: show;
            border: 2px solid #000;
            border-collapse: separate;
            border-spacing: 4px;
            margin-bottom: 20px;
        }
        .hide-empty {
            empty-cells: hide;
            border: 2px solid #000;
            border-collapse: separate;
            border-spacing: 4px;
        }
        td {
            border: 1px solid #666;
            padding: 0;
            width: 60px;
            height: 40px;
        }
        .cell-content {
            width: 50px;
            height: 30px;
            margin: 0;
        }
        .red { background-color: #ff6666; }
        .blue { background-color: #6666ff; }
        .green { background-color: #66ff66; }
        .yellow { background-color: #ffff66; }

